import axios from 'axios';

export const getDocByDay = async (authtoken) => 
     await axios.get(process.env.REACT_APP_API+'/summary/docbyday'
     , {
        headers: {
            authtoken
        }
     });



export const getDocByMonth = async (authtoken) => 
     await axios.get(process.env.REACT_APP_API+'/summary/docbymonth'
     , {
        headers: {
            authtoken
        }
     });

export const getDocByYear = async (authtoken) => 
     await axios.get(process.env.REACT_APP_API+'/summary/docbymonth'
     , {
        headers: {
            authtoken
        }
     });
